import React, {useEffect, useState} from 'react';
import axios from 'axios';
import './App.css';
import './nav.css';
import imagemain from './components/mainlogo.png';

function App() {
  const [hello, setHello] = useState('')

  useEffect(() => {
    axios.get('/api/hello') // get data from backend
        .then(response => setHello(response.data))
        .catch(error => console.log(error))
  }, []);

  return (
      <div>
        //백엔드에서 가져온 데이터입니다 : {hello}
        <div className="subtitle">LET'S GO HIGH-!</div>
        <nav id="menubar">
        <ul>
          <li><a href="#">HIKING FOOTPRINT</a></li>
          <li><a href="#">HIKING DIARY</a></li>
          <li><a href="#">LOGIN</a></li>
          <li><a href="#">SIGN UP</a></li>
          </ul>
        </nav>
        <div className="title">HIGH-GO<br/><br/></div>
        <button className="recommendation">RECOMMENDATION FOR YOU!<br/>
        CLICK ME!</button>
    </div>
  );
}

export default App;
